var listTRSelectedColor = "#F29B74";
var lo_img_wait = "data:image/gif;base64,";

function isObj(obj)
{
    return (!((obj == null) || (obj == undefined)));
}

function showBlockUI(as_msg, b_timeout)
{
    ///<summary>顯示查詢中 call blockUI.js</summary>

    if (isObj($.blockUI))
    {
        if (as_msg == "" || as_msg == undefined)
        {
            $.blockUI({ message: "<h1>資料處理中，請稍後...</h1>", fadeIn: 0 });
        }
        else
        {
            var ls_imageUrl = "<img src=\"" + lo_img_wait + "\" width=\"35\" height=\"30\" />&nbsp";

            if (b_timeout == true)
            {
                $.blockUI(
                    {
                        message: '<h1>' + ls_imageUrl + as_msg + '</h1>'
                        , css: { borderWidth: '0px', backgroundColor: '#87CEFA' }
                        , timeout: 3000
                        , fadeIn: 0
                    }
                );
            }
            else //b_timeout == undefined || b_timeout != true
            {
                $.blockUI(
                    {
                        message: '<h1>' + ls_imageUrl + as_msg + '</h1>'
                        , css: { borderWidth: '0px', backgroundColor: '#87CEFA' }
                        , fadeIn: 0
                    }
                );
            }
        }
    }
}

function hiddenBlockUI()
{
    ///<summary>關閉查詢畫面 call blockUI.js</summary>
    if (isObj($.unblockUI))
    {
        $.unblockUI();
    }
}